// components/Footer.tsx
import React from 'react';
import { Box, Grid, Typography, Link, IconButton } from '@mui/material';
import { Facebook, Twitter, Instagram, LinkedIn } from '@mui/icons-material';

const Footer: React.FC = () => {
  return (
    <Box sx={{ padding: 4, backgroundColor: '#f5f5f5', mt: 4 }}>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={4}>
          <Typography variant="h6">Use Cases</Typography>
          {['UI Design', 'UX Design', 'Wireframing', 'Prototyping'].map((text) => (
            <Link href="#" underline="none" display="block" key={text}>
              {text}
            </Link>
          ))}
        </Grid>
        <Grid item xs={12} sm={4}>
          <Typography variant="h6">Explore</Typography>
          {['Design Systems', 'Collaboration', 'Design Process'].map((text) => (
            <Link href="#" underline="none" display="block" key={text}>
              {text}
            </Link>
          ))}
        </Grid>
        <Grid item xs={12} sm={4}>
          <Typography variant="h6">Resources</Typography>
          {['Blog', 'Best Practices', 'Support', 'Developers'].map((text) => (
            <Link href="#" underline="none" display="block" key={text}>
              {text}
            </Link>
          ))}
          <Box mt={2}>
            {[Facebook, Twitter, Instagram, LinkedIn].map((Icon, index) => (
              <IconButton key={index} color="inherit">
                <Icon />
              </IconButton>
            ))}
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Footer;
